import React from "react";
import Image from "./image";

class Control extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      isDisplay : true,
    };
  }
  render() {
    return (
      <div className='flex hover:bg-blue-300 text-gray-800 bg-green-500 font-semibold  border-gray-400 rounded shadow border'>
        <Image stt= {this.props.stt} numberQuestion={this.props.numberQuestion}/>
      </div>
    );
  }
}
export default Control;
